import React from 'react';
import '../styles/JoinSection.css';

function JoinSection() {
  return (
    <div className="join-section">
      <p className="join-section__text">
        Únete a nuestra comunidad y sé parte del cambio hacia un mundo más sostenible. Comparte y reutiliza con Milahuén.
      </p>
      <button className="join-section__button">Quiero ser parte</button>
    </div>
  );
}

export default JoinSection;
